description: "The female of a \"Tassel Rope-rush\" plant. Wiry tough clumps of blue green stems that were mostly prostrate with some branches standing erect up to about 50 cm. no leaves were seen but the branches had nodes with brownish bracts. Terminal flower heads seemed to have what looked like layered bracts with narrow brown flowers.\r\nMale plants nearby."
